import React from 'react';
import logo from './logo.svg';
import "bootstrap/dist/css/bootstrap.min.css";
import './App.css';

import Home from './components/Home';

function App() {
  return (
    <div>
      <Switch>
          <Route path="/" component={Home} exact/>
      </Switch>
    </div>
  );
}

export default App;
export { App };
